import React from 'react';
import FeatureImg from "../images/feature1.png";

const Card = (props) => {
    return (
        <>
        <div className="feature_box col-md-4">
            <div className="inner">
                <img src={props.featureimg} alt="" />
            <h2 className="title">{props.title}</h2>
            <p class="description">{props.description}</p>
            </div>
        </div>
        </>
    )
}

export default Card
